def filter_metadata(metadata, selected_filters):
    metadata2 = defaultdict(dict)
    for seq in metadata:
        copy = True
        for key in metadata[seq]:
            value = metadata[seq][key]
            for metakey in selected_filters:
                if metakey == key:
                    if metakey == 'date':
                        min_date = selected_filters[metakey][0]['min_val']
                        max_date = selected_filters[metakey][0]['max_val']
                        if min_date is not None:
                            count = min_date.count('-')
                        elif max_date is not None:
                            count = max_date.count('-')
                        format = '%Y-%m-%d'
                        if min_date is not None:
                            if count == 1:
                                min_date = min_date + '-1'
                            date_min = datetime.datetime.strptime(min_date, format)
                        else:
                            date_min = None
                        if max_date is not None:
                            if count == 1:
                                arr_date = max_date.split('-')
                                month = int(arr_date[1])
                                if month == 4 or month == 6 or month == 9 or month == 11:
                                    max_date = max_date + '-30'
                                elif month == 2:
                                    max_date = max_date + '-28'
                                else:
                                    max_date = max_date + '-31'
                            date_max = datetime.datetime.strptime(max_date, format)
                        else:
                            date_max = None
                        value2 = datetime.datetime.strptime(value, '%Y-%m-%d')
                        if date_min is not None and value2 < date_min:
                            copy = False
                        if date_max is not None and value2 > date_max:
                            copy = False
                    else:
                        if value not in selected_filters[metakey]:
                            copy = False
        if copy:
            metadata2[seq] = metadata[seq]
    return metadata2


def create_table_lineage_country():
    table = []
    # all_data = pd.read_csv("apis/all_data.csv", delimiter=',')
    all_data = pd.read_csv("apis/all_data2.csv", delimiter=',')
    all_data_json = all_data.to_json(orient="records")
    json_object = json.loads(all_data_json)
    for item in json_object:
        single_line = {'lineage': item['lineage']}
        country_count = item['country_count']
        country_count = country_count.replace("'", "")
        country_count = country_count.replace("(", "")
        country_count = country_count.replace("[", "")
        country_count = country_count.replace("]", "")
        array_country_count = country_count.split("),")
        for single_country in array_country_count:
            single_country = single_country.replace(")", "")
            array_single_country = single_country.split(',')
            single_line[array_single_country[0]] = array_single_country[1]
        table.append(single_line)
    return table